import React, { Component } from 'react';
import "./index.css";

class Contact extends Component {
  render() {
    return (
      <div className="contentDiv">
        <p id="contentTitle">Contact Us</p>
        <p style={{textAlign:"center"}}>Have a question? Please fill out this form to contact us, or send an email directly to one of the addresses below</p>
        <p><span style={{fontWeight:"bold"}}>Chris Yang</span>&nbsp;<span style={{fontStyle:"italic"}}>Supreme Leader</span> - <a href="">yangcs907@gmail.com</a></p>
      </div>
    )
  };
};

export default Contact;
